const rp = require('request-promise');
const $ = require('cheerio');
const url = 'https://www.hasznaltauto.';

rp(url)
    .then(function(html) {
        //success!!
        const carUrls=[]
        for(i = 0; i < 9; i++) {
            carUrls.push($('.cim-kontener > h3 > a', html)[i].attribs.href)
        }
        console.log(carUrls);
        // console.log($('.cim-kontener > h3 > a', html))
    })
    .catch(function(err) {
        //handle error
        console.log(err)
    })